export default function MensWear() {

    const items = useSelector((state) => state.allCart.items);
    const dispatch = useDispatch();

    return (
        <>

            <div className="container">

                <div className='p-5'>
                    {items.map((item) => (

                        <Product
                            id={item.id}
                            title={item.title}
                            price={item.price}
                            description="a new product"
                            image={item.img}
                        />
                    ))
                    }
                </div>
            </div>
        </>
    )
}
